# Crime Hotspots
## Top ZIP Codes

::: {#69827e1f .cell execution_count=4}
``` {.python .cell-code}
# --- ZIP must be treated as string ---
df["zip_code"] = df["zip_code"].astype(str)

zip_counts = (
    df.groupby("zip_code")
      .size()
      .reset_index(name="crime_count")
      .sort_values("crime_count", ascending=False)
)

top_zip = zip_counts.head(10)

fig = px.bar(
    top_zip.sort_values("crime_count"),
    x="crime_count",
    y="zip_code",
    orientation="h",
    title="Top 10 ZIP Codes by Total Crime",
    template="plotly_white",
)

fig.update_layout(
    yaxis=dict(type="category"),   # Force categorical y-axis
)

fig
