::: {#861e6a4a .cell execution_count=6}
``` {.python .cell-code}
top_desc = df["crime_description"].value_counts().head(10).index

zip_by_desc = (
    df[df["crime_description"].isin(top_desc)]
      .groupby(["crime_description", "zip_code"])
      .size()
      .reset_index(name="crime_count")
)
```
